class Node:

    def __init__(self, data=None):
        self.data = data
        self.next = None

def remove_duplicates(head):
    if not head:
        return head
    seen = set()
    current = head
    seen.add(current.data)
    while current.next:
        if current.next.data not in seen:
            current.next = current.next.next
        else:
            seen.add(current.next.data)
            current = current.next
    return head
